import React, { Component } from 'react';
import cycle1 from './../imgs/cycle/cycle1.svg';
import cycle2 from './../imgs/cycle/cycle2.svg';
import cycle3 from './../imgs/cycle/cycle3.svg';
import co2 from './../imgs/cycle/co2.svg';
import './../css/interactive.css';

class Cycle extends Component {
  render() {
    return (
      <div>
        <img className='cycle1' src={city}/>
        <img className='cycle1' src={car}/>
        <img className='cycle1' src={seaweed}/>
        <img className='co2' src={co2}/>
        <img className='corals' src={corals}/>
      </div>

    );
  }
}

export default Interactive;
